CREATE TABLE public."Municipios"(
    "id" integer NOT NULL,
    "nome" character varying NOT NULL,
    CONSTRAINT infos_pkey PRIMARY KEY ("id", "nome"),
    CONSTRAINT "ID" UNIQUE ("id")
);

CREATE TABLE public."Coordenadas"(
    id_municipio integer NOT NULL,
    ano_atualizacao integer NOT NULL,
    coordenadas polygon,
    CONSTRAINT "Coordenadas_pkey" PRIMARY KEY (ano_atualizacao, id_municipio),
    CONSTRAINT "ID" FOREIGN KEY (id_municipio)
        REFERENCES public."Municipios" (id) MATCH SIMPLE
        ON UPDATE CASCADE
        ON DELETE NO ACTION
);


